import React from "react";

const generateRandomInteger = (maxValue) =>
  Math.floor(Math.random() * maxValue);

class generateRamdonInteger extends React.Component {
  constructor(props) {
    super(props);
    const maxValue = props.maxValue;

    this.state = {
      number: generateRandomInteger(maxValue),
    };
  }
  render() {
    return <span>{this.state.number}</span>;
  }
}

export default generateRamdonInteger;
